How can I manage query parameters that are not always filled?<p>My model looks like this:</p>

<pre><code>const replaySchema = new Schema({

    game: {type: String, required:true},
    link: {type: String, required:true,unique: true},
    player1: {type: String, required: true},
    player2: {type: String, required: true},
    character1: {type: String, required: true},
    character2: {type: String, required: true}


},{
    timestamps:true,
});
</code></pre>

<p>My user fills a form, with the same values as the model where he can leave empty most of the parameters, for example, he can only fill the game and the player1 field.</p>

<p>On submit of the form, a new const is created where it gets the parameters and values of the filled inputs in the form and then sends that to the backend in the <code>params</code> field.</p>

<pre><code>onSubmit(e){
        e.preventDefault();

        const replay = {};

        this.state.game &amp;&amp; (replay.game = this.state.game);
        this.state.player1 &amp;&amp; (replay.player1 = this.state.player1);
        this.state.player2 &amp;&amp; (replay.player2 = this.state.player2);
        this.state.character1 &amp;&amp; (replay.character1 = this.state.character1);
        this.state.character2 &amp;&amp; (replay.character2 = this.state.character2);

        console.log(replay);

        axios.get("http://localhost:5000/search/",
            {params:replay}).then(response =&gt; {
                this.setState({
                    replays: response.data
                })
            }).catch((error) =&gt; {
                console.log(error);
        })
    }
</code></pre>

<p>And the backend was initially going to handle it like this.</p>

<pre><code>
router.route('/').get((req,res) =&gt; {

    console.log(req.query);

   Replay.find(req.query).then(replays =&gt; res.json(replays)).catch(err =&gt; res.status(400).json('Error: ' + err));
});
</code></pre>

<p>However, we decided it's better if when the user enters a value in wichever player field, the db would return replays no matter if it was player1 or player2. Considering all the optional values, as you can see, there are many different queries that can come out from all the different options the user has with filling/not filling each value . </p>

<p>My first thought was to check which values are filled with ifs and make the different queries depending on that, but that would mean more than about 16 different queries, which doesn't sound too clean.</p>

<p>Then I thought about constructing a query string sequentially, but considering mongodb structure for $or and $in, trying to do it like that would almost like doing it with a lot of ifs.</p>

<p>Isn't there an easier way to do this? Thank you.</p>

