MongoDB: How to index unknown fields<p>We're storing documents with a undefined structure. I mean, it has a basic structure (<code>id</code>, <code>user</code> and <code>creationTimestamp</code>), but is also there a <code>Map&lt;String, Object&gt; values</code> fields, where we are able to store whichever structure:</p>

<pre><code>public class Metadata {
    private String id;
    private String user;
    private Date creationTimestamp;
    private Map&lt;String, Object&gt; values;
}
</code></pre>

<p>Example:</p>

<pre><code>&gt; db.metadata.find();
{
    "_id" : "Doc2Ref2Mdt1",
    "user" : "user1",
    "creationTimestamp" : ISODate("2018-09-24T12:20:56.958Z"),
    "values" : {
        "ambit" : "ctti",
        "departament" : "economia"
    }
},
{
    "_id" : "Doc1Ref2Mdt1",
    "user" : "user2",
    "creationTimestamp" : ISODate("2018-09-24T12:20:56.169Z"),
    "values" : {
        "date" : ISODate("2018-09-24T12:20:56.171Z"),
        "number" : 16,
        "address" : {
        "street" : "Av. Diagonal",
        "location" : "barcelona",
        "credentials" : [
        {
            "password" : "pwd",
            "login" : "main"
        },
        {
            "password" : "pwd",
            "login" : "other",
            "creation" : ISODate("2018-09-24T12:20:56.171Z")
        }],
        "contact" : "contact name",
        "tags" : ["tag1", "tag2"}]
    }
}
</code></pre>

<p>So, you can see <code>values</code> can store any structure.</p>

<p>I need to know if mongodb is able to automatically index all of them.</p>

<p>I mean, when a new field is "added" into <code>values</code>, for example, <code>values.newfield</code> it is indexed automatically.</p>

<p>Any ideas?</p>

